import React, { useEffect } from 'react';
import { Link } from 'react-router-dom';
import { servicesAll } from './data';

import './ServicesFull.scss';

const ServicesFull = () => {
	useEffect(() => {
		window.scrollTo(0, 0);
	}, []);

	return (
		<div className='servicesfull' id='servicesfull'>
			<h2 className='servicesfull-heading'>Our Services</h2>

			<div className='card-services'>
				{servicesAll.map((item) => (
					<div className='card'>
						<div className={item.cardFrontClassName}>
							<div className={item.cardImageClassName}>&nbsp;</div>
							<h4 className='card__heading'>
								<span className={item.cardSpanClassName}>{item.text}</span>
							</h4>
						</div>
						<div className={item.cardBackClassName}>
							<div className='card__cta'>
								<div className='card__price-box'>
									<p className='card__price-only'>{item.subheading}</p>
									<p className='card__price-value'>{item.poptext}</p>
								</div>
								<Link to='/booking' className='popup-button'>
									Contact Us
								</Link>
							</div>
						</div>
					</div>
				))}
			</div>
		</div>
	);
};

export default ServicesFull;
